Няма кантактаў для адлюстравання. (Калі вы толькі што дадалі ўліковы запіс, то сінхранізацыя кантактаў можа заняць некалькі хвілін.)

Каб дадаць кантакты, націсніце Меню, і далей націсніце:

Уліковыя запісы, каб дадаць ці наладзiць уліковы запіс з кантактамі, які можна сінхранізаваць з тэлефонам;

Параметры адлюстравання, каб наладзiць, якія кантакты адлюстроўваюцца

Новы кантакт, каб стварыць новы кантакт "з чыстага лiста";

Імпарт/экспарт, каб імпартаваць кантакты з %s-карты ці SD-карты.

Няма кантактаў для адлюстравання. (Калі вы толькі што дадалі ўліковы запіс, то сінхранізацыя кантактаў можа заняць некалькі хвілін.)

Каб дадаць кантакты, націсніце Меню і выберыце:

Уліковыя запісы, каб дадаць ці наладзiць уліковы запіс з кантактамі, які можна сінхранізавць з тэлефонам;

Параметры адлюстравання, каб змяніць, якія кантакты адлюстроўваюцца;

Новы кантакт, каб стварыць новы кантакт з нуля;

Імпарт/экспарт, каб імпартаваць кантакты з SD-карты.

У вас няма нічога ў спісе "Выбранае".

Каб дадаць кантакт у гэты спіс:

 дакраніцеся да ўкладкі Кантакты;

 дакраніцеся да кантакта, які трэба дадаць у "Выбранае";

дакраніцеся да зоркі побач з імем кантакту
.
